    <title>My Tube</title>
    <style>
        @import url('https://fonts.googleapis.com/css2?family=Lato:wght@900&display=swap');

        body {
            display: flex;
            background-color: white;
            width: 100vw;
            height: 100vh;
            font-family: 'Lato', sans-serif;
            ;
        }

        h1 {
            color: black;
        }

        nav {
            background-color: white;
            height: 60px;
            display: flex;
            align-items: center;
            background-repeat: no-repeat;
            background-size: cover;
        }

        ul {
            display: flex;
            list-style: none;

        }

        li {
            padding-left: 20px;
            padding-right: 10px;

        }

        #search {
            background-color: white;

            width: 500px;
            height: 30px;
            border: 2px solid rgba(0, 0, 0, 0.3);
            margin-left: 150px;
        }

        #srch {
            border: 1px solid rgba(0, 0, 0, 0.3);
        }

        hr {
            border: 1px solid rgba(0, 0, 0, 0.3);
            width: 90%;
        }

        iframe {
            margin-left: 40px;
            margin-top: 30px;
        }

        #buttons {
            width: 100vw;
            height: 30px;
        }

        #button {
            border-radius: 100px;
            background-color: 0, 0, 0, 0.5;
            margin-left: 80px;
            height: 29px;
            width: 40px;
            border: 1px solid rgba(0, 0, 0, 0.3);

        }

        #button1 {
            border-radius: 100px;
            background-color: 0, 0, 0, 0.5;
            margin-left: 30px;
            height: 29px;
            width: 80px;
            border: 1px solid rgba(0, 0, 0, 0.3);

        }

        #button,
        #button1:hover {
            background-color: black;
            color: white;
        }

        sup {
            font-size: 15px;
            color: rgba(0, 0, 0, 0.7);
        }

        href {
            color: black;

        }

        #head {
            flex: 12;
        }

        #tab {
            flex: 1;
            text-align: center;
            font-size: 15px;
            font-family: 'Urbanist', sans-serif;
            height: 100vh;
        }

        #main {
            display: flex;
            flex-direction: column;
        }

        #main2 {
            display: flex;
        }
    </style>
</head>
